import {
  MDBBtn,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBCardTitle,
  MDBCardText,
  MDBCol,
} from "mdbreact";

function Homepage(){
    return (
      <MDBCol>
        <MDBCard style={{ width: "100%", height:"450px" }}>
          <MDBCardBody>
            <MDBCardTitle>Card title</MDBCardTitle>
            <MDBCardText>
              Some quick example text to build on the card title and make up the
              bulk of the card&apos;s content.
            </MDBCardText>
          </MDBCardBody>
        </MDBCard>
      </MDBCol>
    );
}

export default Homepage;
